descr:
Fica a pessoa jurídica notificada sobre a entrega dos laudos de análise, do tipo orientação, emitidos e analisados pelo Laboratório de Saúde Pública Dr. Giovanni Cysneiros - LACEN de produtos coletados  no comércio de Anápolis, cuja fabricação ocorre neste estabelecimento:
1. laudo de análise 1654.1P.0/2024 do produto "café torrado e moído", marca Docê, validade 11/06/2025 e lote 551J, com parecer satisfatório para todas as análises realizadas;
2. laudo de análise 1902.1P.0/2024 do produto "mel", marca Rancheiro, validade 07/2026 e lote 22612, com parecer satisfatório para todas as análises realizadas.;
3. laudo de análise 1389.1P.0/2024 do produto "mel", marca Rancheiro, validade 07/2026 e lote 22612, com parecer satisfatório para todas as análises realizadas.
As coletas correspondem ao Programa de Monitoramento de qualidade.
